{
  "name": "UBX-AID-INI",
  "class_id": "0x0B",
  "message_id": "0x01",
  "description": "Aiding position, time, frequency, clock drift",
  "message_type": "input_output",
  "payload": {
    "length": {
      "fixed": 48
    },
    "fields": [
      {
        "name": "ecefXOrLat",
        "byte_offset": 0,
        "data_type": "I4",
        "description": "WGS84 ECEF X coordinate or latitude, depending on flags below",
        "unit": "cm_ or_ deg",
        "scale": {
          "raw": "1e-7",
          "multiplier": 0.0000001
        }
      },
      {
        "name": "ecefYOrLon",
        "byte_offset": 4,
        "data_type": "I4",
        "description": "WGS84 ECEF Y coordinate or longitude, depending on flags below",
        "unit": "cm_ or_ deg",
        "scale": {
          "raw": "1e-7",
          "multiplier": 0.0000001
        }
      },
      {
        "name": "ecefZOrAlt",
        "byte_offset": 8,
        "data_type": "I4",
        "description": "WGS84 ECEF Z coordinate or altitude, depending on flags below",
        "unit": "cm"
      },
      {
        "name": "posAcc",
        "byte_offset": 12,
        "data_type": "U4",
        "description": "Position accuracy (stddev)",
        "unit": "cm"
      },
      {
        "name": "tmCfg",
        "byte_offset": 16,
        "data_type": "X2",
        "description": "Time mark configuration",
        "bitfield": {
          "bits": [
            {
              "name": "fEdge",
              "bit_start": 6,
              "bit_end": 6,
              "description": "use falling edge (default rising)"
            },
            {
              "name": "tm1",
              "bit_start": 4,
              "bit_end": 4,
              "description": "time mark on extint 1 (default extint 0)"
            },
            {
              "name": "f1",
              "bit_start": 1,
              "bit_end": 1,
              "description": "frequency on extint 1 (default extint 0)"
            }
          ]
        }
      },
      {
        "name": "wnoOrDate",
        "byte_offset": 18,
        "data_type": "U2",
        "description": "Actual week number or yearSince2000/Month (YYMM), depending on flags below",
        "unit": "week or_ yearMonth"
      },
      {
        "name": "towOrTime",
        "byte_offset": 20,
        "data_type": "U4",
        "description": "Actual time of week or DayOfMonth/Hour/Minute/Second (DDHHMMSS), depending on flags below",
        "unit": "ms_ or_ dayHourMinuteSec"
      },
      {
        "name": "towns",
        "byte_offset": 24,
        "data_type": "I4",
        "description": "Fractional part of time of week",
        "unit": "ns"
      },
      {
        "name": "tAccMs",
        "byte_offset": 28,
        "data_type": "U4",
        "description": "Milliseconds part of time accuracy",
        "unit": "ms"
      },
      {
        "name": "tAccNs",
        "byte_offset": 32,
        "data_type": "U4",
        "description": "Nanoseconds part of time accuracy",
        "unit": "ns"
      },
      {
        "name": "clkDOrFreq",
        "byte_offset": 36,
        "data_type": "I4",
        "description": "Clock drift or frequency, depending on flags below",
        "unit": "ns/s_ or_ Hz",
        "scale": {
          "raw": "1e-2",
          "multiplier": 0.01
        }
      },
      {
        "name": "clkDAccOrFreqAcc",
        "byte_offset": 40,
        "data_type": "U4",
        "description": "Accuracy of clock drift or frequency, depending on flags below",
        "unit": "ns/s_ or_ ppb"
      },
      {
        "name": "flags",
        "byte_offset": 44,
        "data_type": "X4",
        "description": "Bitmask with the following flags",
        "bitfield": {
          "bits": [
            {
              "name": "pos",
              "bit_start": 0,
              "bit_end": 0,
              "description": "Position is valid"
            },
            {
              "name": "time",
              "bit_start": 1,
              "bit_end": 1,
              "description": "Time is valid"
            },
            {
              "name": "clockD",
              "bit_start": 2,
              "bit_end": 2,
              "description": "Clock drift data contains valid clock drift, must not be set together with clockF"
            },
            {
              "name": "tp",
              "bit_start": 3,
              "bit_end": 3,
              "description": "Use time pulse"
            },
            {
              "name": "clockF",
              "bit_start": 4,
              "bit_end": 4,
              "description": "Clock drift data contains valid frequency, must not be set together with clockD"
            },
            {
              "name": "lla",
              "bit_start": 5,
              "bit_end": 5,
              "description": "Position is given in lat/long/alt (default is ECEF)"
            },
            {
              "name": "altInv",
              "bit_start": 6,
              "bit_end": 6,
              "description": "Altitude is not valid, if lla was set"
            },
            {
              "name": "prevTm",
              "bit_start": 7,
              "bit_end": 7,
              "description": "Use time mark received before AID-INI message (default uses mark received after message)"
            },
            {
              "name": "utc",
              "bit_start": 10,
              "bit_end": 10,
              "description": "Time is given as UTC date/time (default is GPS wno/tow)"
            }
          ]
        }
      }
    ]
  }
}

Please review your earlier extraction against the consensus structure from multiple manuals.

Message version being compared: v0

